import './TodoTextCreate.css';
function TodoTextCreate({newTask}) {
    return (
        <input className='TodoTextCreate' 
        type="text"
        placeholder='add task' 
        value={newTask}
        onChange={(e) => newTask(e.target.value)}
        />
    );
}
export { TodoTextCreate};
